import logo from './logo.svg';
import './App.css';
import React, { useState, useEffect } from 'react';
import { type } from '@testing-library/user-event/dist/type';

function App() {

  const [nursesList, setNursesList] = useState([]);
  const [shiftsList, setShiftsList] = useState([]);

  const callApi = async () => {
    const response = await fetch('/nurses');
    const body = await response.json();
    if (response.status !== 200) throw Error(body.message);

    return body;
  };

  const callApi2 = async () => {
    var responseClone;
    const response = await fetch('http://localhost:9001/nurses', {
      method: "GET",
    }).then(function (response) {
      responseClone = response.clone(); // 2
      console.log("Response JSON ----");
      const resp = JSON.parse(response.body);
      console.log({ resp });
      // console.log(response.json());
      // console.log(type(response.json));
      return response.json();
    }).then(function (data) {
      // Do something with data
    }, function (rejectionReason) { // 3
      console.log('Error parsing JSON from response:', rejectionReason, responseClone); // 4
      responseClone.text() // 5
        .then(function (bodyText) {
          console.log('Received the following instead of valid JSON:', bodyText); // 6
          console.log(typeof bodyText);
        });
    });
  };

  const callApi3 = async () => {
    var responseClone;
    const response = await fetch('http://localhost:9001/nurses', {
      method: "GET",
    }).then(function (response) {
      responseClone = response.clone(); // 2
      console.log("GOOD");
      return responseClone.text();
    }).then(function (bodyText) {
      console.log('Received THIS body text:', bodyText); // 6
      console.log(typeof bodyText);
      console.log(JSON.parse(bodyText));
      // setNursesList(bodyText);
    });
  };

  const callApi3_2 = async () => {
    var responseClone;
    const response = await fetch('http://localhost:9001/nurses', {
      method: "GET",
    }).then(function (response) {
      responseClone = response.clone();
      return responseClone.text()
        .then(function (bodyText11) {
          console.log({ bodyText11 });
          return { bodyText11 };
        });
    });
  };

  const fetchNurses = async () => {
    const response = await fetch('http://localhost:9001/nurses');
    const respText = await response.text();
    if (response.status !== 200) throw Error(respText.message);

    return respText;
  };

  const fetchShifts = async () => {
    const response = await fetch('http://localhost:9001/shifts');
    const respText = await response.text();
    if (response.status !== 200) throw Error(respText.message);

    return respText;
  };

  useEffect(() => {
    console.log("Start of useEffect");
    fetchNurses()
      .then(res => {
        // console.log({ res });
        // console.log(JSON.parse(res));

        // Need to parse because response is a string literal containing an array of objects
        const nurses = JSON.parse(res);
        setNursesList(nurses);

        console.log("End of fetchNurses in useEffect -- Success");
      }).catch(err => {
        console.log(err);
        console.log("End of fetchNurses in useEffect -- Failure");
      });

    fetchShifts()
      .then(res => {
        // console.log({ res });
        // console.log(JSON.parse(res));

        // Need to parse because response is a string literal containing an array of objects
        const shifts = JSON.parse(res);
        setShiftsList(shifts);

        console.log("End of fetchShifts in useEffect -- Success");
      }).catch(err => {
        console.log(err);
        console.log("End of fetchShifts in useEffect -- Failure");
      });
  }, []);

  return (
    <div className="App">
      <p> Title here </p>
      {nursesList.map(nurse => {
        <p>{nurse}</p>
      })}
      {/* <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header> */}
    </div>
  );
}

export default App;
